import React, {useEffect, useState} from 'react';
import PokeList from './pokeassets/PokeList';
import { Pokemon } from './types/types'
import './main.css';




/* Test case pokemon */
const pokemons = [
  {
    name: 'Weedle',
    id: 12,
    types: ['Bug', 'Poison'],
    abilities:['Shed Skin'],
    image: 'https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/versions/generation-ii/crystal/shiny/13.png',
    user: 'user@email.com'
  }
]

function App() {

  const [pokeList, setPokeList] = useState<Pokemon[]>([])

  useEffect(()=>{
    // fetch pokemon from PokeAPI
    const getPokeListData = async () => {
      const apiUrl: string = "https://pokeapi.co/api/v2";
      const limit: number = 20;
      const offset: number = 0;
      const url: string = `${apiUrl}/pokemon?limit=${limit}&offset=${offset}`;

      try {
        const response = await fetch(url);
        if(!response.ok) {
          throw new Error("Network response was not ok")
        }
      } catch (error) {
        
      }

    }

  },[])

  return (
    <div className="App">
      <PokeList pokemons={pokemons} />
    </div>
  );
}

export default App;
